            {
                $.ajax({                 
                    url :'/h-cart-ajaxAdd.html',
                    type:'POST',
                    data:{
                        goods_id : goods_id,                    
                        sale_id  : sale_id,
                        qty      : qty,
                        master_sale_id : master_sale_id
                    },
