    $.fn.autocompleteCountry= function(options) {
        if(!$(this)[0]) return;
        var me = this,$this = $(this),$input = $('ul input',this);
        var defaults = {data:{},tecoData:{}};
        var options = $.extend(defaults, options);
        var active = -1;
        var hasFocus = false;
        var html = '';
        var timeout = null;
        var lastKeyPressCode = null;
        this.getSub = function(obj){
            var _s = obj.text().substr(0, 15);
            if(obj.text().length>16) _s = _s+'...';
            var _em = ''+_s+'';
            return _em;
        };
        this.getCurrency = function (){
            return $('.yourCurrency em',$this).attr('class').replace(/flag /,'').replace(/flag /,'');
        };
        this.requestData = function(){
            for(var i in options.tecoData){ 
                html += '
'+options.tecoData[i]+'';
            }
            html += '
';
            for(var i in options.data){ 
                html += '
'+options.data[i]+'';
            }
            $('.dropdown-menu ul',$this).html(html);
            $('.dropdown-menu ul a',$this).unbind('mousedown').bind('mousedown',function(){
                trackingClickDom($(this));
            });
            $('.dropdown-menu ul li a',$this).click(function(){
                if(!$(this).parent().hasClass('noResul')){
                    $('.yourCurrency').html(me.getSub($(this)));
                    hasFocus=false;
                    var _cut = me.getCurrency();		
                    $.ajax({
                            type: 'GET',
                            url: '/h-Module-changeMyDelivery.html?code='+_cut,
                            data: '',
                            complete: function() {},
                            success: function(data) {
                                    if(data!=''&&data==1){
                                        location.href=location.href;
                                    }
                            },
                            error: function() {}
                    });
                    me.clearMenus();
                    $this.removeClass('open');
                    zhcart_data['cutSel'] = _cut;
                    return false;
                }
                return false;
            }).hover(
            function() { 
                $('.dropdown-menu ul li',$this).removeClass('over');
                active = $('.dropdown-menu ul li',$this).index(this);
            },
            function() {
                //	$this.removeClass('open');
            }
        );
            html = '';	
        };
        //	$('.dropdown-toggle',$this).click(function(){$this.toggleClass('open');});
        $(this).hover(function(){hasFocus=true;},function(){hasFocus=false;});
        $(document).click(function(){
            //	me.clearMenus();
        });

        $('.dropdown-toggle').click(function(){
            me.clearMenus();
        });
        this.clearMenus = function() {
            if(!hasFocus){
                if($(this).hasClass('open')){me.requestData();}
                //	$this.removeClass('open');
                $input.val('');
                hasFocus=false;
            }
        };
        this.showResult = function() {
            if($input.val()=='') {
                me.requestData();
                return;
            };
            me.requestData();
            var t = 0;
            $('.dropdown-menu ul li',$this).each(function(n){
                //if(n<20) $(this).remove();
                if($(this).text().toLowerCase().indexOf($input.val().toLowerCase())==0) {
                    t++;
                }else if($(this).hasClass('divider')){
                }else{
                    $(this).remove();
                }
                if(n==20&&t==0){
                    $(this).remove();
                } 
            });
            if(t == 0){
                $('.dropdown-menu ul',$this).html('
No result match"'+$input.val()+'"');
            }
        };
        this.onChange = function() {
            if((lastKeyPressCode >= 33 && lastKeyPressCode <= 45) 
                || lastKeyPressCode == 144 || lastKeyPressCode == 145 || lastKeyPressCode == 9
                || (lastKeyPressCode >= 112 && lastKeyPressCode <= 135)) 
                return;
            me.showResult();
        };
        this.moveSelect = function(step) {
            var lis = $('.dropdown-menu ul li',$this);
            active += step;
            if (active < 0) {
                active = lis.size() - 1;
            } else if (active >= lis.size()) {
                active = 0;
            };
            if(!$(lis).hasClass('noResul')){
                $(lis).find('a').removeClass('over');
                $(lis).find('a').eq(active).addClass('over');
                $input.val($(lis).eq(active).text());
            }
        };
        this.init = function(){
            zhcart_data['cutSel'] = me.getCurrency();
            me.requestData();
        };
        $input
        .keyup(function(e) {
            hasFocus = true;
            lastKeyPressCode = e.keyCode;
            if(lastKeyPressCode < 37 || lastKeyPressCode > 40) {
                active = -1;
                if (timeout) clearTimeout(timeout);
                timeout = setTimeout(function(){me.onChange();}, options.delay);
            };
        }).keydown(function(e) {
            lastKeyPressCode = e.keyCode;
            switch(e.keyCode) {
                case 13:
                    if($input.val()!=''){
                        //var t = 0;
                        $('.dropdown-menu ul li',$this).each(function(n){
                            if($(this).text()!=''&&$(this).text()==$input.val()) {
                                $('.yourCurrency').html(me.getSub($(this)));
                                hasFocus=false;
                                me.clearMenus();
                                $this.removeClass('open');
                                zhcart_data['cutSel'] = me.getCurrency();
                                //t++;
                                return;
                            }														
                        });
                    }
                    break;
                case 38: // up
                    e.preventDefault();
                    me.moveSelect(-1) ;
                    break;
                case 40: // down
                    e.preventDefault();
                    me.moveSelect(1);
                    break;
                default:
                    break;
            };
        });
        me.init();
    };
    $.fn.topButtonToggle =function(options){
        var me = this,$this = $(this);
        var defaults = {show:''};
        me.options = $.extend(defaults, options);
