             $(this).parent().find('.quickcart_box').show();
             _this=$(this);
             if($(this).parent().find('.quickcart_box').html()=="" || $(this).parent().find('.quickcart_box').html()=="Loading...")
             {
                        createAjaxLoading();
                        $(this).parent().find('.quickcart_box').css('position', 'absolute');
